// Your web app's Firebase configuration
// For Firebase JS SDK v7.20.0 and later, measurementId is optional
const firebaseConfig = {
    apiKey: "AIzaSyCM5XONFH1LTJkCRs-dkUFD0CsGEq_Bb-w",
    authDomain: "finaldestination-ecbf9.firebaseapp.com",
    projectId: "finaldestination-ecbf9",
    storageBucket: "finaldestination-ecbf9.appspot.com",
    messagingSenderId: "621735536080",
    appId: "1:621735536080:web:a12a951dfd53695099c5d5",
    measurementId: "G-HBRPLYEBN4"
};

// Initialize Firebase
export const app = initializeApp(firebaseConfig);
export const analytics = getAnalytics(app);
